import { StyleSheet } from 'react-native'; 

export const globalStyles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
    logo: {
        width: 305,
        height: 159,
        marginBottom: 10,
    },
    instructions: {
        color: '#888',
        fontSize: 18,
        marginHorizontal: 15,
    }, 
    button: {
        backgroundColor: "blue",
        padding: 20,
        borderRadius: 5,
    },
    buttonText: {
        fontSize: 20,
        color: '#fff',
    }, 
    thumbnail: {
        width: 300,
        height: 300,
        resizeMode: "contain"
    },

    questionContainer: {
        ...StyleSheet.absoluteFill, 
        alignItems: 'center',
        justifyContent: 'flex-end',
        height: '15%'
    }
});
